import { Button, Flex, Input,Text } from "@chakra-ui/react";
import { useDispatch } from "react-redux";
import { register, resetPassword } from "../../redux/AuthSlice";
export default function LogIn() {
    const dispath = useDispatch()
    return (
        <Flex flexDirection={'column'} width={'100%'}>
           <Input placeholder="login" marginBottom={'5%'} borderC/>
           <Input placeholder="password" />

           <Flex marginTop={'5%'} flexDirection={'row'}>
            <Text flexDirection={'row'}>Forget your &nbsp;</Text>
            <Text color={'blue.400'} fontWeight='600' onClick={() => {
                dispath(resetPassword())
            }}> password ?</Text>
            </Flex> 
            <Button 
            bg={'blue.200'}
            fontWeight={'600'}
            _hover={{ bg: 'blue.100' }}
            marginTop={'5%'}
            onClick={() => {
                console.log('button')
                dispath(register())
            }}>Sign Up</Button>

        </Flex>
    )
}
